// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "contracts/models/ModelLibrary.sol";

contract DebtsContract {
    using ModelLibrary for ModelLibrary.Creditor;

    mapping(address => ModelLibrary.Creditor) public debtsList;
    uint256 currentDebtAmount;
    uint256 allTimePayback;
    uint256 public debtFund;

    event newDebt(uint256 indexed amount);
    event repayDebtsToZero(uint256 indexed amount);

    function createDebtsList(
        address debtor,
        address creditor,
        uint256 amount,
        uint256 fees,
        uint256 addToDebtFund
    ) public returns (bool) {
        // Ensure the debtor doesn't already have debts
        require(
            debtsList[debtor].getDebtAmount() == 0,
            "Debtor already have debts."
        );
        require(amount > 0, "Amount of debts have to be greater than 0.");
        require(fees > 0, "Interest has to be greater than 0.");

        // Create a new creditor and set them as the creditor for the debtor
        debtsList[debtor] = ModelLibrary.createCreditor(
            creditor,
            amount,
            fees,
            block.timestamp
        );
        currentDebtAmount = currentDebtAmount + amount;
        debtFund = debtFund + addToDebtFund;
        emit newDebt(amount);
        return true;
    }

    /* The function is intended for debtors to repay their debts to their creditors. 
    After the repayment, it checks if the creditor also has debts. If so, the money 
    is directly forwarded to their creditors, leading to recursion, which can result 
    in high gas fees.*/

    function repayDebts(
        address debtor,
        address creditor,
        uint256 amount
    ) public returns (uint256 restDebts) {
        // Ensure the debtor-creditor pair is available
        require(
            debtsList[debtor].getCreditorAddress() == creditor,
            "Debtor-Credit-Pair is unvailable."
        );
        // Calculate the interest
        uint256 debtsInterest = calculateInterestUntil(
            debtsList[debtor].getDebtAmount(),
            debtsList[debtor].getTimeOfDebt(),
            block.timestamp,
            debtsList[debtor].getInterest()
        );
        // Update amount of debts to sum of debts plus interest
        debtsList[debtor].setDebtAmount(
            (debtsList[debtor].getDebtAmount() + debtsInterest)
        );
        // Update timestamp to Zero
        debtsList[debtor].setTimeOfDebt(block.timestamp);
        // Check if the debt plus the interest are greater than or equal to the repayment amount
        bool debtsHigherEqualsInput = (debtsList[debtor].getDebtAmount()) >=
            amount;
        uint256 restAfterDebtsRepaying = 0;
        if (debtsHigherEqualsInput) {
            // If the debt plus the interest are greater than or equal to the repayment amount, subtract the repayment amount from the debt
            debtsList[debtor].setDebtAmount(
                debtsList[debtor].getDebtAmount() - amount
            );
            currentDebtAmount = currentDebtAmount - amount;
            allTimePayback = allTimePayback + amount;
            // Emit an event to signal that the debts have been fully repaid
            emit repayDebtsToZero(amount);
        } else {
            // If the debt is less than the repayment amount, calculate the remaining amount after repaying the debt
            restAfterDebtsRepaying = amount - debtsList[debtor].getDebtAmount();
            debtsList[debtor].setDebtAmount(0);
            currentDebtAmount =
                currentDebtAmount -
                amount +
                restAfterDebtsRepaying;
            allTimePayback = allTimePayback + amount - restAfterDebtsRepaying;
        }
        // Check if the creditor's debt amount becomes zero after the repayment
        // if (debtsList[creditor].getDebtAmount() == 0) {
        //     // If the creditor's debt amount becomes zero, return the remaining amount after repaying the debts
        //     // return restAfterDebtsRepaying;
        // } else {
        //     // If the creditor still has remaining debts, repay them to the next creditor recursively
        //     address newCreditor = debtsList[creditor].getCreditorAddress();
        //     repayDebts(creditor, newCreditor, restAfterDebtsRepaying);
        // }
        return restAfterDebtsRepaying;
    }

    function immediateRepayment(address debtor) public{

    }

    function getDebtsCreditorAndAmount(address debtor)
        public
        view
        returns (address, uint256)
    {
        return (
            debtsList[debtor].getCreditorAddress(),
            debtsList[debtor].getDebtAmount()
        );
    }

    function calculateInterestUntil(
        uint256 principalAmount,
        uint256 startTimestamp,
        uint256 endTimestamp,
        uint256 interestRate
    ) private pure returns (uint256) {
        require(
            endTimestamp >= startTimestamp,
            "Start and end timestamps don't match"
        );

        uint256 elapsedDays = (endTimestamp - startTimestamp) / 1 days;
        uint256 annualInterest = (principalAmount * interestRate) / 100;
        uint256 dailyInterest = annualInterest / 365; // daily interest

        uint256 interest = elapsedDays * dailyInterest;
        return interest;
    }
}

