// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

library ModelLibrary{
    struct Creditor{
        address creditorAddress;
        uint256 debtAmount;
        uint256 interest; // in percent
        uint256 timeOfDebt;
    }

    function createCreditor(address _creditorAddress, uint256 _debtAmount, uint256 _interest, uint256 _timeOfDebt) public pure returns (Creditor memory) {
        return Creditor(_creditorAddress, _debtAmount, _interest, _timeOfDebt);
    }

     function getCreditorAddress(Creditor storage self) internal view returns (address) {
        return self.creditorAddress;
    }

    function setDebtAmount(Creditor storage self, uint256 _debtAmount) internal {
        self.debtAmount = _debtAmount;
    }

    function getDebtAmount(Creditor storage self) internal view returns (uint256) {
        return self.debtAmount;
    }

    function getInterest(Creditor storage self) internal view returns (uint256) {
        return self.interest;
    }

    function setTimeOfDebt(Creditor storage self, uint256 _timeOfDebt) internal {
        self.timeOfDebt = _timeOfDebt;
    }

    function getTimeOfDebt(Creditor storage self) internal view returns (uint256) {
        return self.timeOfDebt;
    }
}

